def find_bi_reachable_houses(n, k, query_function):

    def MyIter(n):
        for k in range(n - 1, 0, -1):
            i = 0
            while i + k < n:
                yield (i, i + k)
                i += 1
    dct = [[] for _ in range(n)]
    for (i, el) in enumerate(k):
        dct[el].append(i + 1)
    for (i, j) in MyIter(n):
        for a in dct[i]:
            for b in dct[j]:
                if query_function(b, a) == 'Yes':
                    return (a, b)
    for j in range(n):
        if len(dct[j]) > 2:
            return tuple(dct[j][:2])
    return (0, 0)

